	add("butterball", "{\"term\":\"butterball\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|butter|ball|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A round lump of a coagulated fat used in cooking such as butter, margarine, or a sprea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An overweight person\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Vicki Lansky, \u0027Fat-Proofing your Children – so that they Never Become Diet-Addicted Adults\u0027, page 62\u0026lt;!---[http://books.google.com/books?id\u003dX1MQAQAAMAAJ\u0026amp;q\u003d%22is+a+butterball%22\u0026amp;dq\u003d%22is+a+butterball%22\u0026amp;hl\u003den\u0026amp;ei\u003dzie_TvLIH4O6hAeFg4igBA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d8\u0026amp;ved\u003d0CEsQ6AEwBw]---\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;What if your baby is a \u0027\u0027butterball\u0027\u0027? Does Fat-Proofing mean you should put your infant on diet?.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A small North American duck\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1917\u0027\u0027, in the \u0027Hunter-Trader-Trapper\u0027, volume 34, page 37\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The skipper had his eye on a bunch of \u0027\u0027butterballs\u0027\u0027 feeding not far from the boat. In fact there were ducks all around — though he did not tell me so\", \"priority\":7}]}, \"synonyms\":{}}");

