	add("butterfly", "{\"term\":\"butterfly\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"low german\", \"Dutch\"], \"text\":\"From Middle english (1100-1500) {{m|enm|buterflie|buterflie, butturflye, boterflye}}, from Old english (ca. 450-1100) {{m|ang|buttorfleoge|butorflēoge, buttorflēoge, buterflēoge}}. Cognate with Dutch {{m|nl|botervlieg}}, German {{m|de|Butterfliege||butterfly}}.Perhaps a compound of \u0027butor-\u0027 \u0027beater\u0027, mutation of \u0027bēatan\u0027 \u0027to beat\u0027, and \u0027flēoge\u0027 \u0027fly\u0027.\u0026lt;ref\u0026gt;Donald A. Ringe, \u0027A Linguistic History of English: From Proto-Indo-European to Proto-Germanic\u0027 (Oxford: Oxford, 2003), 232.\u0026lt;/ref\u0026gt; More at beat and fly. Alternate etymology connects the first element to {{m|ang|butere||butter}}, as the name may have originally been applied solely to butterflies of a yellowish color. This may have merged later with the belief that butterflies ate milk and butter (compare: German {{m|de|Molkendieb}} and Low german {{m|nds|Botterlicker||butterfly|lit\u003dbutter-licker}}), or that they excreted a butter-like substance (compare: Dutch {{m|nl|boterschijt||butterfly|lit\u003dbutter-shitter}}). More at {{l|en|butter}}, {{l|en|fly}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flying insect of the order \u0027Lepidoptera\u0027, distinguished from moths by their diurnal activity and generally brighter colouring\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone seen as being unserious and (originally) dressed gaudily; someone flighty and unreliable\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, Henry James, \u0027What Maisie Knew\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The day came indeed when her breathless auditors learnt from her in bewilderment that what ailed him was that he was, alas, simply not serious. Maisie wept on Mrs. Wix\u0027s bosom after hearing that Sir Claude was a \u0027\u0027butterfly\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The butterfly stroke\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A use of surgical tape, cut into thin strips and placed across an open wound to hold it closed\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"butterfly\u0027\u0027 tape\", \"priority\":7}]}, \"synonyms\":{}}");

