	add("button", "{\"term\":\"button\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Proto-Germanic\"], \"text\":\"{{borrowing|fro|boton|lang\u003den}} (French {{m|fr|bouton}}), itself either from {{m|la|*bottōnem}}, probably ultimately from a Proto-germanic language, or from {{m|fro|bouter}} + {{m|fro|-on}}.Image:Brownell\u0027s trouser button.jpg|thumb|right|150px|Shirt button (sense 1)Image:Enter_button.jpg|thumb|right|150px|Push button (sense 2)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A knob or disc that is passed through a loop or (buttonhole), serving as a fastener\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dI liked the man for his own sake, and even had he promised to turn out a celebrity it would have had no weight with me. I look upon notoriety with the same indifference as on the \u0027\u0027buttons\u0027\u0027 on a man\u0027s shirt-front, or the crest on his note-paper\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A mechanical device meant to be pressed with a finger in order to open or close an electric circuit or to activate a mechanism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An on-screen control that can be selected as an activator of an attached function\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A badge worn on clothes, fixed with a pin through the fabric\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A bud\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The clitoris\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The center (bullseye) of the house\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The soft circular tip at the end of a foil\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A plastic disk used to represent the person in last position in a poker game; also \u0027dealer\u0027s \u0027\u0027button\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The player who is last to act after the flop, turn and river\u0026lt;!--but not preflop--\u0026gt;, who possesses the button\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A raised pavement marker to further indicate the presence of a pavement marking painted stripe\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A methaqualone tablet (used as a recreational drug\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A piece of wood or metal, usually flat and elongated, turning on a nail or screw, to fasten something, such as a door\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A globule of metal remaining on an assay cupel or in a crucible, after fusion\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A knob; a small ball; a small, roundish mass\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A small white blotch on a cat\u0027s coat\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A unit of length equal to 1/12 of an inch\", \"priority\":18}]}, \"synonyms\":{}}");

