	add("buttress", "{\"term\":\"buttress\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"frankish\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027bouterés\u0027 () nominative singular of \u0027bouteret\u0027 from Frankish {{m|frk|*botan}}, from Proto-germanic {{m|gem-pro|*bautaną||to push}}. Ultimately cognate with \u0027beat\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A brick or stone structure built against another structure to support it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything that serves to support something; a prop\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A buttress-root\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A feature jutting prominently out from a mountain or rock; a crag, a bluff\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"w:Crowell Crowell Buttresses, w:Dismal Dismal Buttress, w:Hourglass Hourglass Buttress, w:Kardam Kardam Buttress, w:Seven Seven Buttresses Image:Milestone thumb|right|Milestone Buttress on Tryfan. The direct route is highlighted\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Will Cook, \u0027Until Darkness Disappears\u0027, page 54\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"All that day they rode into broken land. The prairie with its grass and rolling hills was behind them, and they entered a sparse, dry, rocky country, full of draws and short cañons and ominous \u0027\u0027buttresses\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Tony Howard, \u0027Treks and Climbs in Wadi Rum, Jordan\u0027, ISBN-13: 9781852842543, page 84\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Two short pitches up a chimney-crack are followed by a traverse right to the centre of the \u0027\u0027buttress\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Anything that supports or strengthens\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"the ground pillar and \u0027\u0027buttress\u0027\u0027 of the good old cause of nonconformity\", \"priority\":11}]}, \"synonyms\":{}}");

